import React, { Component } from 'react';

export default class CompanyShowcase extends Component {
    constructor(props) {
        super(props);
        this.state = {
            companies: [
                'backendImages/1711334451338.jpg',
                'backendImages/1711334495090.png',
                'backendImages/1711334577343.jpeg',
                // Add more dummy image paths as needed
            ],
        };
    }

    render() {
        return (
            <div>
                <h2>Company Showcase</h2>
                <div className="gallery">
                    {this.state.companies.map((imagePath, index) => (
                        <div key={index} className="gallery-item">
                            <img src={`http://localhost:8080/${imagePath}`} alt={`Company ${index + 1}`} />
                            <div className="company-name">Company {index + 1}</div>
                        </div>
                    ))}
                </div>
            </div>
        );
    }
}
